	float scopeScale = 1.0f;
	int octave = 4;

	float modWaveA = 0.0f;
	float waveALevel = 0.0f;
	float modWaveB = 0.0f;
	float waveBLevel = 0.0f;
	float modDetune = 0.0f;
	float modOctave = 0.0f;
	float modNoiseLevel = 0.0f;
	float modSlewShape = 0.0f;
	float modSlewLength = 0.0f;
	float filterResp = 0.5;
	float filterRes = 1.0f;
	float filterDrive = 1.0f;
	float filterMix = 0.0f;

	float tuningFreq = 440.0f;


	float displayFreq = 1.0f;
	bool showWindow = true;

	MonoVoice(const string name_, const float sampleRate_, Input* userParams_, shared_ptr<ModMatrix> matrix_, shared_ptr<NoteMatrix> noteMatrix_) {
		name = name_;
		sampleRate = sampleRate_;
		userParams = userParams_;
		matrix = matrix_;
		noteMatrix = noteMatrix_;

		InitializePinkNoise(&pink, 12);

		oscillators.resize(2);
		
		shittyscope.resize(1024, 0.0f);

		for (auto& n : notes) {
			n.n = 0;
		}

		for (auto& o : oscillators) {
			o = make_unique<monoOsc>(sampleRate);
		}

		filter.setSampleRate(sampleRate);

		vca = make_unique<Vca>(name, sampleRate, userParams, matrix, noteMatrix);

		interfaceList = {
			{ true, name + " Octave",     0.0f, 1.0f, &modOctave},
			{ true,	name + " WaveA",      0.0f, 1.0f, &modWaveA },
			{ true,	name + " ALevel",     0.0f, 1.0f, &waveALevel },
			{ true,	name + " WaveB",      0.0f, 1.0f, &modWaveB },
			{ true,	name + " BLevel",     0.0f, 1.0f, &waveBLevel },
			{ true,	name + " Noise",      0.0f, 1.0f, &modNoiseLevel },
			{ true,	name + " Detune",     0.0f, 1200.0f, &modDetune },
			{ true, name + " SlewShape",  0.0f, 1.0f, &modSlewShape},
			{ true, name + " SlewLength", 0.0f, 1.0f, &modSlewLength},
			{ true, name + " Tone",       0.0f, 1.0f, &filterResp},
			{ true, name + " Resonance",  0.0f, 4.0f, &filterRes},
			{ true,	name + " Drive",      1.0f, 2.0f, &filterDrive }
		};

		noteInterfaceList = {
			{true, name + " In", &notes}
		};



	}

	inline float centsMult(const int cents_) {
		return round(100000.0f * pow(2.0f, (static_cast<float>(cents_) / 100.0f / 12.0f))) / 100000.0f;
	}

	inline float noteToFreq(const int n_) {
		return powf(2.0f, static_cast<float>(n_ - 69) / 12.0f) * tuningFreq;
	}


	void processAudio(pair<float, float>& in_) {
		float monoSample = 0.0f;
		pair<float, float> stereoSample(0.0f, 0.0f);
		const float freq = noteToFreq(notes[0].n + ((octave * modOctave) * 12));

		displayFreq = freq;

		oscillators[0]->setFreq(freq);
		oscillators[0]->setSlew(modSlewShape, modSlewLength);
		oscillators[0]->setWave(static_cast<monoOsc::Waves>(static_cast<int>(2.0f * modWaveA)));

		oscillators[1]->setFreq(freq * centsMult(modDetune));
		oscillators[1]->setSlew(modSlewShape, modSlewLength);
		oscillators[1]->setWave(static_cast<monoOsc::Waves>(static_cast<int>(2.0f * modWaveB)));

		monoSample += oscillators[0]->wav() * waveALevel;
		monoSample += oscillators[1]->wav() * waveBLevel;
		monoSample += GeneratePinkNoise(&pink, rng) * modNoiseLevel;
		monoSample /= max<float>(1.0f, waveALevel + waveBLevel + modNoiseLevel);

		filter.setFreq(minCutoff * powf(maxCutoff / minCutoff, filterResp));
		filter.SetDrive(filterDrive);
		filter.SetResonance(filterRes);
		
		filter.process(monoSample);
		monoSample = lerp(filter.LowPass(), filter.HighPass(), filterMix);

		shittyscope[scopeIdx] = monoSample;
		scopeIdx++;
		if (scopeIdx >= shittyscope.size()) {
			scopeIdx = 0;
		}

		stereoSample = make_pair(monoSample, monoSample);

		vca->processAudio(stereoSample);

		if (fxChain.size() > 0) {
			for (auto& fx : fxChain) {
				fx->processAudio(stereoSample);
			}
		}

		in_ = stereoSample;
	}

	void display() {

		ImGui::SetNextWindowSize(ImVec2(200, 100), ImGuiCond_FirstUseEver);
		ImGui::Begin(name.c_str(), &showWindow);
		ImGui::PushID(name.c_str());
		ImGui::Separator();

		ImGui::Text("Current Freq %.03f", displayFreq);
		ImGui::SliderInt("Max Octave", &octave, 0, 6, "%.03f");

		ImGui::PushID("Voice Parameters");
		ImGui::Text("Voice Parameters");

		//Migrate to BaseObject
		int ifdx = 0;
		for (auto& ep : interfaceList) {
			ImGui::SliderFloat(ep.name.c_str(), ep.resP, ep.min, ep.max, "%.03f");
			mplusButton(ifdx);
			ifdx++;
		}

		ImGui::PopID();
		ImGui::Separator();
		ImGui::Text("");
		ImGui::Text("Ur-Scope");
		ImGui::PlotLines("Osc 0 output Buffer", &shittyscope[0], static_cast<int>(scopeScale * shittyscope.size()), 0, "Sample", -1.0f, 1.0f, ImVec2(200, 100));
		ImGui::SliderFloat("Scope Scale", &scopeScale, 0.1, 1.0f);
		ImGui::Separator();



		ImGui::PushID("MonoEffectList");
		if (ImGui::TreeNode("MonoEffects")) {
			for (int i = 0; i < monoEffectList.size(); i++) {
				ImGui::Text(monoEffectList[i].c_str()); //Make a version that takes a function pointer or something
				if (ImGui::IsItemClicked()) {
					switch (i) {
					case 0:
						fxChain.push_back(make_unique<DelayEffect>(name + " Delay", sampleRate, userParams, matrix, noteMatrix));
						break;
					case 1:
						fxChain.push_back(make_unique<DistortionEffect>(name + " Distortion", sampleRate, userParams, matrix, noteMatrix));
						break;
					case 2:
						fxChain.push_back(make_unique<ShapeEffect>(name + " Shape", sampleRate, userParams, matrix, noteMatrix));
						break;
					case 3:
						fxChain.push_back(make_unique<ChorusEffect>(name + " Chorus", sampleRate, userParams, matrix, noteMatrix));
						break;
					case 4:
						fxChain.push_back(make_unique<PhaserEffect>(name + " Phaser", sampleRate, userParams, matrix, noteMatrix));
						break;

					case 5:
						fxChain.push_back(make_unique<BlackStarEffect>(name + " BS", sampleRate, userParams, matrix, noteMatrix));
						break;

					}
					ImGui::SetNextTreeNodeOpen(0, 1);
				}
			}
			ImGui::TreePop();
		}
		ImGui::PopID();
		ImGui::Separator();

		ImGui::PushID("Vca");
		vca->display();
		ImGui::PopID();


		ImGui::PushID("MONOEffectControls");
		for (auto& fx : fxChain) {
			ImGui::Separator();
			fx->display();
		}
		ImGui::PopID();

		ImGui::PopID();
		ImGui::End();

	}


	json toConfig() {
		json config = ModuleBase::toConfig();

		config["octave"] = octave;
		config["modDetune"] = modDetune;
		config["tuningFreq"] = tuningFreq;
		config["modOctave"] = modOctave;

		config["modWaveA"] = modWaveA;
		config["waveALevel"] = waveALevel;
		config["modWaveB"] = modWaveB;
		config["waveBLevel"] = waveBLevel;
		config["modNoiseLevel"] = modNoiseLevel;
		config["modSlewShape"] = modSlewShape;
		config["modSlewLength"] = modSlewLength;
		config["filterResp"] = filterResp;
		config["filterRes"] = filterRes;
		config["filterDrive"] = filterDrive;

		config["Vca"].push_back(vca->toConfig());

		for (auto& fx : fxChain) {
			config["fxChain"].push_back(fx->toConfig());
		}

		return config;
	}


	void loadConfig(const json cfg) {

		ModuleBase::loadConfig(cfg);

		if (cfg.count("modWaveA"))
			modWaveA = cfg["modWaveA"].get<float>();
		if (cfg.count("waveALevel"))
			waveALevel = cfg["waveALevel"].get<float>();
		if (cfg.count("modWaveB"))
			modWaveB = cfg["modWaveB"].get<float>();
		if (cfg.count("waveBLevel"))
			waveBLevel = cfg["waveBLevel"].get<float>();
		if (cfg.count("modNoiseLevel"))
			modNoiseLevel = cfg["modNoiseLevel"].get<float>();
		if (cfg.count("modSlewShape"))
			modSlewShape = cfg["modSlewShape"].get<float>();
		if (cfg.count("modSlewLength"))
			modSlewLength = cfg["modSlewLength"].get<float>();
		if (cfg.count("filterResp"))
			filterResp = cfg["filterResp"].get<float>();
		if (cfg.count("filterRes"))
			filterRes = cfg["filterRes"].get<float>();

		if (cfg.count("filterDrive"))
			filterDrive = cfg["filterDrive"].get<float>();

		if (cfg.count("octave"))
			octave = cfg["octave"].get<int>();

		if (cfg.count("modDetune"))
			modDetune = cfg["modDetune"].get<float>();

		if (cfg.count("tuningFreq"))
			tuningFreq = cfg["tuningFreq"].get<float>();

		if (cfg.count("modOctave"))
			modOctave = cfg["modOctave"].get<float>();

		if (cfg.count("Vca")) {
			vca->loadConfig(cfg["Vca"][0]);
		}

		if (cfg.count("fxChain")) {
			for (auto& fxj : cfg["fxChain"]) {

				if (fxj.count("type")) {
					if (fxj["type"].get<string>().compare("struct DelayEffect") == 0) {
						fxChain.push_back(make_unique<DelayEffect>(name + " Delay", sampleRate, userParams, matrix, noteMatrix));
						fxChain.back()->loadConfig(fxj);
					}
					if (fxj["type"].get<string>().compare("struct DistortionEffect") == 0) {
						fxChain.push_back(make_unique<DistortionEffect>(name + " Distortion", sampleRate, userParams, matrix, noteMatrix));
						fxChain.back()->loadConfig(fxj);
					}
					if (fxj["type"].get<string>().compare("struct ShapeEffect") == 0) {
						fxChain.push_back(make_unique<ShapeEffect>(name + " Shape", sampleRate, userParams, matrix, noteMatrix));
						fxChain.back()->loadConfig(fxj);
					}

					if (fxj["type"].get<string>().compare("struct ChorusEffect") == 0) {
						fxChain.push_back(make_unique<ChorusEffect>(name + " Chorus", sampleRate, userParams, matrix, noteMatrix));
						fxChain.back()->loadConfig(fxj);
					}

					if (fxj["type"].get<string>().compare("struct PhaserEffect") == 0) {
						fxChain.push_back(make_unique<PhaserEffect>(name + " Phaser", sampleRate, userParams, matrix, noteMatrix));
						fxChain.back()->loadConfig(fxj);
					}

					if (fxj["type"].get<string>().compare("struct BlackStarEffect") == 0) {
						fxChain.push_back(make_unique<BlackStarEffect>(name + " BS", sampleRate, userParams, matrix, noteMatrix));
						fxChain.back()->loadConfig(fxj);
					}

				}

			}
		}

	}

